import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { FlatList } from 'react-native-gesture-handler';

const name = [
    { name: 'name1' },
    { name: 'name2' },
    { name: 'name3' },
    { name: 'name4' },
    { name: 'name5' },
    { name: 'name6' },
    { name: 'name7' },
    { name: 'name8' },
]
const ListScreen = () => {
    return (
        <FlatList
            data={name}
            renderItem={({ item }) => {
                return <Text>{item.name}</Text>
            }}
        />

    )
}

const style = StyleSheet.create({})


export default ListScreen
